import React, { useEffect, useState } from "react";
import axios from "axios";
function DashBoard() {
  useEffect =
    (async () => {
      try {
        const data = await (await axios.get("/api/room/getallrooms")).data;
        console.log(data);
      } catch (error) {}
    },
    []);
  return (
    <div>
      <h1>Roooms</h1>
    </div>
  );
}

export default DashBoard;
